INSERT INTO `act_form_tpl` VALUES ('common-test:0', 'common-test', 0, '<table class=\"gridtable\">\r\n	<tr>\r\n		<th><span v-if=\"editable\" class=\"need\">*</span>说明</th>\r\n		<td>\r\n			<textarea v-if=\"editable\"  v-model=\"form.info\"  datatype=\"*\" nullmsg=\"请输入详细说明\" rows=\"5\" style=\"width: 100%;\"></textarea>\r\n		   <template v-else>{{form.info}}</template>\r\n		</td>\r\n	</tr>\r\n</table>\r\n<div class=\"sub-title\">参与人</div>\r\n<table class=\"gridtable\">\r\n	<tr v-if=\"editable\">\r\n		<td colspan=\"4\"><button type=\"button\" class=\"sub-btn\" v-on:click=\"handleAdUser\">增行</button></td>\r\n	</tr>\r\n	<tr>\r\n		<th><span v-if=\"editable\" class=\"need\">*</span>员工用户名</th>\r\n		<th v-if=\"editable\">操作</th>\r\n	</tr>\r\n	<tr v-for=\"(user, index) in form.users\" :key=\"index\">\r\n		<td>\r\n			<input v-if=\"editable\" v-model=\"form.users[index]\" type=\"text\" datatype=\"*\"/>\r\n			<template v-else>{{user}}</template>\r\n		</td>\r\n		<td v-if=\"editable\"><button type=\"button\" v-on:click=\"handleRemoveUser(index)\" class=\"sub-btn\">删</button></td>\r\n	</tr>\r\n</table>\r\n<script>\r\n	function data(){\r\n		return {\r\n			editable: true,\r\n			form: {\r\n				info: \'\',\r\n				users:[\'\']\r\n			}\r\n		};\r\n	}\r\n	function methods(){\r\n		return {\r\n			handleRemoveUser: function (index) {\r\n				console.log(\"remove ary index: \" + index);\r\n				if(this.form.users.length === 1){\r\n					alert(\'至少选择一个人\');\r\n					return;\r\n				}\r\n				this.form.users.splice(index, 1);\r\n			},\r\n			handleAdUser: function () {\r\n				var user = \'\';\r\n				this.form.users.push(user);\r\n			}\r\n		}\r\n	}\r\n</script>', '通用测试表单', NULL, '1', 'admin', '2020-07-17 11:31:58', 'admin', '2020-07-17 12:28:30');
INSERT INTO `act_form_tpl` VALUES ('holiday-request:0', 'holiday-request', 0, '<table class=\"gridtable\">\r\n<tr>\r\n	<th><span v-if=\"editable\" class=\"need\">*</span>请假类型</th>\r\n	<td colspan=\"3\">\r\n		<select v-if=\"editable\"  v-model=\"form.leaveType\"   datatype=\"*\" nullmsg=\"请选择请假类型\" style=\"width: 180px;\">\r\n			<option value=\"\">请选择</option>\r\n			<option value=\"事假\">事假</option>\r\n			<option value=\"病假\">病假</option>\r\n			<option value=\"年假\">年假</option>\r\n		</select>\r\n		<template v-else>\r\n			{{form.leaveType}}\r\n		</template>\r\n	</td>\r\n</tr>\r\n<tr>\r\n	<th><span v-if=\"editable\" class=\"need\">*</span>开始时间</th>\r\n	<td>\r\n		<input v-if=\"editable\" v-model=\"form.startTime\" type=\"text\" datatype=\"*\" nullmsg=\"请选择开始时间\" class=\"datetime\" />\r\n		<template v-else>{{form.startTime}}</template>\r\n	</td>\r\n	<th><span v-if=\"editable\" class=\"need\">*</span>结束时间</th>\r\n	<td>\r\n		<input v-if=\"editable\" v-model=\"form.endTime\" id=\"test\" type=\"text\" datatype=\"*\" nullmsg=\"请选择结束时间\" class=\"datetime\"/>\r\n		<template v-else>{{form.endTime}}</template>\r\n	</td>\r\n</tr>\r\n<tr>\r\n	<th><span v-if=\"editable\" class=\"need\">*</span>请假原因</th>\r\n	<td colspan=\"3\">\r\n		<textarea v-if=\"editable\" v-model=\"form.leaveReason\" datatype=\"*\" nullmsg=\"请输入请假原因\" rows=\"5\" style=\"width: 100%;\"></textarea>\r\n		<template v-else>{{form.leaveReason}}</template>\r\n	</td>\r\n</tr>\r\n</table>\r\n<script>\r\n	function data() {\r\n		return {\r\n			editable: true,\r\n			form: {\r\n				leaveType: \'\',\r\n				leaveReason: \'\',\r\n				startTime: \'\',\r\n				endTime: \'\'\r\n			}\r\n		}\r\n	}\r\n	function methods() {\r\n		return {\r\n		}\r\n	}\r\n</script>', '请假表单', 'DatePicker', '1', 'admin', '2020-07-17 15:34:10', NULL, NULL);
INSERT INTO `act_form_tpl` VALUES ('purchase-request:0', 'purchase-request', 0, '<!--用于开发 流程申请表单模板-->\r\n<!-- 此处填充表单代码 -->\r\n<table class=\"gridtable\">\r\n    <tr>\r\n        <th><span v-if=\"editable\" class=\"need\">*</span>物资类型</th>\r\n        <td>\r\n            <select v-if=\"editable\"  v-model=\"form.type\" style=\"width: 180px;\"  datatype=\"*\" nullmsg=\"请选择物资类型\">\r\n                <option value=\"\">请选择物资类型</option>\r\n                <option value=\"办公用品\">办公用品</option>\r\n                <option value=\"生产物料\">生产物料</option>\r\n                <option value=\"后勤劳保\">后勤劳保</option>\r\n            </select>\r\n            <template v-else>\r\n                {{form.type}}\r\n            </template>\r\n        </td>\r\n        <th ><span v-if=\"editable\" class=\"need\">*</span>最晚到货时间</th>\r\n        <td>\r\n            <input v-if=\"editable\" v-model=\"form.dueTime\" type=\"text\" datatype=\"*\" nullmsg=\"请选择最晚到货时间\" class=\"date\"/>\r\n            <template v-else>{{form.dueTime}}</template>\r\n        </td>\r\n    </tr>\r\n    <tr>\r\n        <th><span v-if=\"editable\" class=\"need\">*</span>申请原因</th>\r\n        <td colspan=\"3\">\r\n            <textarea v-if=\"editable\" v-model=\"form.reason\" datatype=\"*\" nullmsg=\"请输入申请原因\" rows=\"5\" style=\"width: 90%;\"></textarea>\r\n            <template v-else>{{form.reason}}</template>\r\n        </td>\r\n    </tr>\r\n</table>\r\n<div class=\"sub-title\">物资子表</div>\r\n<table class=\"gridtable\"  >\r\n    <tr v-if=\"editable\">\r\n        <td v-bind:colspan=\"editable?5:4\"><button type=\"button\" class=\"sub-btn\" v-on:click=\"handleAddPerson\">增行</button></td>\r\n    </tr>\r\n    <tr>\r\n        <th><span v-if=\"editable\" class=\"need\">*</span>名称</th>\r\n        <th><span v-if=\"editable\" class=\"need\">*</span>品牌</th>\r\n        <th><span v-if=\"editable\" class=\"need\">*</span>款式</th>\r\n        <th>数量</th>\r\n        <th v-if=\"editable\">操作</th>\r\n    </tr>\r\n    <tr v-for=\"(item, index) in form.products\" :key=\"index\">\r\n        <td>\r\n            <input style=\"width: 180px;\" v-if=\"editable\" v-model=\"item.name\" type=\"text\" datatype=\"*\"/>\r\n            <template v-else>{{item.name}}</template>\r\n        </td>\r\n        <td>\r\n            <input style=\"width: 180px;\" v-if=\"editable\" v-model=\"item.brand\" type=\"text\" datatype=\"*\"/>\r\n            <template v-else>{{item.brand}}</template>\r\n        </td>\r\n        <td>\r\n            <input style=\"width: 180px;\" v-if=\"editable\" v-model=\"item.desc\" type=\"text\" datatype=\"*\"/>\r\n            <template v-else>{{item.desc}}</template>\r\n        </td>\r\n        <td>\r\n            <input style=\"width:95px;\" v-if=\"editable\" v-model=\"item.amount\" type=\"text\" datatype=\"n\"/>\r\n            <template v-else>{{item.amount}}</template>\r\n        </td>\r\n        <td v-if=\"editable\"><button type=\"button\" v-on:click=\"handleRemovePerson(index)\" class=\"sub-btn\">删</button></td>\r\n    </tr>\r\n</table>\r\n<!---->\r\n\r\n<!--此处填充数据绑定、操作业务逻辑-->\r\n<script>\r\n    /* vue data */\r\n    function data() {\r\n        return {\r\n            editable: true,\r\n            form: {\r\n                type: \"\",\r\n                reason: \"\",\r\n                dueTime: \"\",\r\n                products: [\r\n                    {\r\n                        name: \'\',\r\n                        brand: \'\',\r\n                        age: \'\',\r\n                        sex: \'\',\r\n                    }\r\n                ]\r\n            }\r\n        }\r\n    }\r\n    /*  vue methods */\r\n    function methods() {\r\n       return {\r\n           handleRemovePerson: function (index) {\r\n               console.log(\"remove ary index: \" + index);\r\n               if(this.form.products.length === 1){\r\n                   alert(\'采购单最少需要一个商品\');\r\n                   return;\r\n               }\r\n               this.form.products.splice(index, 1);\r\n           },\r\n           handleAddPerson: function () {\r\n               var product = {\r\n                   name: \'\',\r\n                   brand: \'\',\r\n                   desc: \'\',\r\n                   amount: 1,\r\n               };\r\n               this.form.products.push(product);\r\n           },\r\n       }\r\n   }\r\n</script>\r\n<!---->\r\n', '物资采购申请', 'DatePicker', '1', 'admin', '2020-07-19 17:29:57', 'admin', '2020-07-19 18:06:33');
